import './App.css';
import './styles/header.css';
import backgroundapp from './background-fon1.jpg';
import logo from './rose.png';
import banner from './banner.png'

function App() {
  return (
    <div className="App">
       <img className = "backgroundapp" src = {backgroundapp}/>
      <header className="App-header">
        <div className = "App-header-left">
          <img className = "logo-header" src = {logo}/>
          <span className = "App-text-header-left">ЦВЕТОК</span>
        </div>
        <div className = "App-header-right">
          <span className = "text-app-header-right">О нас</span>
          <span className = "text-app-header-right">Каталог</span>
          <span className = "text-app-header-right">Сопутствующие товары</span>
          <span className = "text-app-header-right">Аккаунт</span>
          <span className = "text-app-header-right">Создать свой букет</span>
        </div>
        <div className = "banner-header">
          <img src = {banner}></img>
        </div>
      </header>
    </div>
  );
}

export default App;
